import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

// 1) Robust Monkey-patch ResizeObserver globally BEFORE React or Monaco load
(() => {
  const NativeRO = window.ResizeObserver;
  if (!NativeRO) return;
  window.ResizeObserver = class ResizeObserver {
    constructor(callback) {
      // wrap callback to ignore only loop errors
      const wrapped = (entries, observer) => {
        try {
          callback(entries, observer);
        } catch (err) {
          if (
            err.message &&
            err.message.includes('ResizeObserver loop completed with undelivered notifications.')
          ) {
            // swallow this specific error
          } else {
            // rethrow anything else
            throw err;
          }
        }
      };
      this._ro = new NativeRO(wrapped);
    }
    observe(target, options) {
      this._ro.observe(target, options);
    }
    unobserve(target) {
      this._ro.unobserve(target);
    }
    disconnect() {
      this._ro.disconnect();
    }
  };
})();

// 2) Suppress other benign runtime errors
window.addEventListener('error', e => {
  const m = e.message || '';
  if (m === 'Script error.' || m.includes('Canceled')) {
    e.preventDefault();
    e.stopImmediatePropagation();
  }
});
window.addEventListener('unhandledrejection', e => {
  const m = (e.reason && e.reason.message) || '';
  if (m === 'Script error.' || m.includes('Canceled')) {
    e.preventDefault();
    e.stopImmediatePropagation();
  }
});

// 3) Bootstrap React App
const container = document.getElementById('root');
const root = createRoot(container);
root.render(<App />);
